    star_test!(example4, star1, "aabAAB", "6");
    star_test!(example5a, star1, "dabAcCaCBAcCcaDA", "10");
    star_test!(empty, star1, "", "0");
    star_test!(me1, star1, ME, "9704");

    star_test!(example5b, star2, "dabAcCaCBAcCcaDA", "4");
    star_test!(me2, star2, ME, "6942");

    const ME: &str = indoc! {"
        
    "};
